"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/24439276/g.-stanley-herman\n</p>\n<p>\nAge 79. Died in Warsaw. Employee of the former Warsaw Elevator Co. Member of Warsaw First Baptist Church and was active in the Golden Agers. A US Marine veteran of WWI. Survived by his wife, Elizabeth; a son George of Warsaw; a daughter, Mildred Hart of Lindrum, S.C.; 2 brothers, Roy of Warsaw and Theodore of Hacienda, CA; 6 grandchildren and a great grandchild.\n</p>\n</div>\n</div>",
