"<div>\n<i class=\"NoteType\">\nObituary\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWyoming County Times Thursday July 3, 1958\n</p>\n<p>\nMiles G. Herman, a farmer of the West Hill, Warsaw who had been ill for a long time passed away suddenly at his home on Thursday June 26th. He was born in Orangeville on October 6, 1882 the son of Theodore and Louise Streamer Herman and on January 17, 1906 he married Nellie Reitzel, who survives together with three children, Mrs. Marvin S. Cohen of Niagara Falls, N.Y., Onias N. herman and Richard Herman of Warsaw, six grandchildren, a brother; William Herman of Los Angeles, California and a sister, Mrs. Walter Wilcox of Warsaw. The funeral was held at the Weeks Funeral Home on Sunday, June 29th at 2:30 o'clock with the interment in the Warsaw cemetery. The Rev. Frederick Carlsen of the Evangelical United Brethren church officiated.\n</p>\n</div>\n</div>",
"",
"",
"<div>\n<i class=\"NoteType\">\nFind A Grave\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18316146/onias-m.-herman\n</p>\n<p>\nAge 57 of Warsaw, died Thursday, May 2, 1968 in a truck accident in Monticello, NY. Mr. Herman was employed by Levi Harner of Bloomsburg, Pa. a driver and trainer of harness racing horses, well known in Western New York. Mr. Herman was reported to have been en route to Delevan from Delaware when the accident occurred. He was a native of Warsaw. Survivors are his mother, Mrs. Nellie Herman; a brother, Richard of Warsaw and a sister, Mrs. Eleanor Cohen of Niagara Falls; nieces and nephews. Funeral services were held Sunday at the Weeks Funeral Home, Warsaw with burial in Warsaw cemetery.\n</p>\n</div>\n</div>",
"",
"",
"<div>\n<i class=\"NoteType\">\nFind A Grave\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/47331822/richard-l.-herman\n</p>\n<p>\nAge 84 of Liberty St., Warsaw died at Wyoming Co. Comm. Hospital in Warsaw. He was born in Orangeville, NY, son of the late Miles &amp; Nellie Reitzel Herman. He was a self employed farmer for any years in Warsaw and then worked for over 20 years as a heavy machine operator for the Wyoming Co. Highway Dept. before retiring in 1984. He played town team baseball for many years in Warsaw and played trumpet in the Warsaw Vounteer Fire Dept. Band, the Howard Lewis Band and Al Harvey's Jazz Reading Group. Mr. Herman was a member of Immanuel United Methoist Church, Warsaw, Wyoming Co. CSEA and the Warsaw Volunteer Exempt Firemen. He was a former member of Warsaw Fire Dept., Erie Hose Co. and Loyal Order of the Moose #560 in Warsaw He was an avid gardener. Surviving are his wife of 62 years, Dorothy Crawford Herman, 3 sons, James (Nancy) Herman of Warsaw, William (Carrie) Herman of Rochester, Peter Herman of Orangeville; 4 daughters, Patricia (Gary) Hume of Gainesville, Betsy (Craig) Adams of Palmyra, VA, Myra (Charles) Lutomski of Woodstock, Cheryl (Don) Merrill of Malvern, PA., 16 grandchildren, 10 great-grandchildren. He was he brother of the late Onias Herman and Eleanor Cohen. Robinson &amp; Hackemer Funeral Home handled arrangements.\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
