"<div>\n<i class=\"NoteType\">\nFind A Grave\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18554593/william-h.-herman\n</p>\n<p>\nAge 83, A Wyoming County native died in Los Angeles, CA., where he lived for the past 15 years. He was the son of Theodore and Louise Streamer Herman and is survived by a sister, Mrs. Walter Wilcox of Warsaw and a niece and several nephews. Prior to his retirement he was employed by the Shontz Button factory in Rochester.\n</p>\n</div>\n</div>",
