"<div>\n<i class=\"NoteType\">\nFind A Grave\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18662708/nellie-m.-herman\n</p>\n<p>\nAge 97 of Brooklyn Street, Warsaw. Died in the Rutherford Lodge in Dale. Native of Orangeville. Employed during WWII in the former Buffalo Curtis Wright Plant. Also worked at the former Warsaw Elevator Plant and owned and operated her own boarding home. Member of Warsaw Evangelical United Methodist Church and Warsaw Friendly Rebekah Lodge. Her husband Miles G. Herman died in 1958. Survivors include 1 daughter, Eleanor Cohen of Niagara Falls, 1 son, Richard of Warsaw, 8 grandchildren and 13 great grandchildren.\n</p>\n</div>\n</div>",
