"<div>\n<i class=\"NoteType\">\nFind A Grave\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/65691114/norman-a.-smith\n</p>\n<p>\nHe was born April 19, 1918, in Orangeville, son of the late Abraham and Mary Baker Smith.\n</p>\n<p>\nNorman was a veteran of the U.S. Army having served during World War II in Africa, Italy and South France.\n</p>\n<p>\nHe was predeceased by his wife of 67 years, Lucille Brown Smith who died in 2009.\n</p>\n</div>\n</div>",
