"<div>\n<i class=\"NoteType\">\nFind A Grave\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.findagrave.com/memorial/18554553/louise-herman\n</p>\n<p>\nMRS. OLIVER FULLINGTON<br />\nThe death of Mrs. Oliver Fullington occurred at the home of her son, Earl Herman early on Monday morning after an illness of many months. Mrs. Fullington was born in the town of Orangeville on November 25, 1856 and was the daughter of the late Mr. and Mrs. Phillip Streamer. She has always resided in the vicinity. Surviving her are four sons, Earl Herman of Warsaw, Walter Herman of Buffalo, William Herman of Rochester and Miles Herman of Orangeville; one daughter, Mrs. Clara Wilcox of Warsaw, four sisters, Mrs. George Christ and Mrs. Jacob Streamer of Warsaw, Mrs. Millard Fullington of Orangeville and Mrs. Handy Collins of Saint Lawrence Country; and six grandchildren.<br />\nShe was first married to Theodore Herman and after his death to Oliver Fullington, who she survived.<br />\nThe Funeral Services were held from the house where she died on Wednesday afternoon at 2 o\u2019clock. The Reverend Rothen of the West Warsaw Evangelical Church officiating. Burial was made in the Warsaw Cemetery.<br />\nObituary published in the Wyoming County Times, Warsaw, New York on Thursday February 28, 1918.\n</p>\n<p>\nNote: Date of birth on headstone is 1857. Obituary states 1856 as year of birth.\n</p>\n</div>\n</div>",
